import React, { createElement, Fragment } from "react";
import './index.css'

export const H2old = (props) =>
  createElement("h1", { className: "test-1", style: props.style }, [
    "Sample Heading",
    createElement("span", {}, "13123"),
  ]);

  // properties
const H2 = ({ title, subHeading }) => (
  <h2 className="">
    {title} - {String(subHeading)}
  </h2>
);

const H1 = ({ children, style }) => children ? (
  <h1 className="" style={style}>{children}</h1>
) : null;

H1.defaultProps = {
  style: {
    color: 'yellow'
  }
}

class App extends React.Component {
  render() {
    // JSX
    return (
      <div style={{ background: 'green' }} onClick={(e) => { alert('clicked') }}>
        <H2 title="Sample 1" subHeading />
