            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
